import { Data, Params } from 'src/request/entity.d';
import { post, upload } from "src/request/api"

// 我的推荐
export const queryPagination = (params: Params) => {
 return post('/index/redlists/redlists/getMyRedLists', params)
}

// 修改用户信息
export const updateUserInfo= (data: Data) => {
 return post('/index/redlists/sysuser/update', data)
}

// 修改头像
export const uploadHeader = (data: any) => {
 return upload('/index/redlists/sysuser/upload', data)
}

// 置顶
export const updateToTop = (params: Params) => {
 return post('/index/redlists/redlists/setTop', params)
}
// 登出
export const logout = (params: Params) => {
 return post('/index/redlists/sysuser/logout', params)
}
